(function () {
  /**
   * CONFIGURACIÓN DE ESTILO Y DISEÑO DEL PDF
   * Centraliza todos los estilos aquí para facilitar cambios futuros.
   */
  const PDF_CONFIG = {
    margins: {
      top: 60,
      bottom: 60,
      left: 40,
      right: 40,
    },
    colors: {
      primary: [16, 185, 129], // Verde Esmeralda (para cabeceras de tabla)
      textPrimary: [31, 41, 55], // Gris Oscuro (casi negro)
      textSecondary: [107, 114, 128], // Gris Medio
      border: [209, 213, 219], // Gris Claro para bordes
    },
    fonts: {
      headerSize: 20,
      titleSize: 12,
      normalSize: 10,
      footerSize: 8,
    },
    // IMPORTANTE: Reemplaza esta cadena base64 con la de tu propio logo.
    // Puedes usar un convertidor online (busca "image to base64").
    logoBase64:
      "data:image/png;base64,",
  };

  /**
   * Recolecta los datos del préstamo desde la interfaz de usuario.
   * @returns {object} Objeto con toda la información del préstamo.
   */
  function collectDataFromUI() {
    const getElText = (id) =>
      document.getElementById(id)?.textContent?.trim() || "N/A";

    const cronogramaRows = Array.from(
      document.querySelectorAll("#res-cronograma-body tr")
    ).map((tr) => {
      const cols = Array.from(tr.children).map(
        (c) => c.textContent?.trim() || ""
      );
      return {
        numero: cols[0] || "",
        fecha: cols[1] || "",
        montoCuota: cols[2] || "",
      };
    });

    return {
      cliente: getElText("res-cliente"),
      dni: getElText("res-dni"),
      monto: getElText("res-monto"),
      tea: getElText("res-tea"),
      fechaInicio: getElText("res-fecha-inicio"),
      plazo: getElText("res-plazo"),
      cuota: getElText("res-cuota"),
      pep: getElText("res-pep"),
      cronograma: cronogramaRows,
    };
  }

  /**
   * Genera y exporta el cronograma de pagos como un archivo PDF.
   */
  async function exportCronogramaPdf() {
    const data = collectDataFromUI();

    const jsPDF = window.jspdf?.jsPDF;
    if (!jsPDF) {
      console.error(
        "jsPDF no está cargado. Usando window.print() como fallback."
      );
      window.print();
      return;
    }

    const doc = new jsPDF({ unit: "pt", format: "a4" });
    const pageWidth = doc.internal.pageSize.getWidth();
    let finalY = PDF_CONFIG.margins.top; // Rastreador de la posición vertical

    // --- 1. Encabezado con Logo y Título ---
    doc.addImage(
      PDF_CONFIG.logoBase64,
      "PNG",
      PDF_CONFIG.margins.left,
      finalY - 20,
      50,
      50
    );
    doc.setFont("helvetica", "bold");
    doc.setFontSize(PDF_CONFIG.fonts.headerSize);
    doc.setTextColor(...PDF_CONFIG.colors.textPrimary);
    doc.text("Cronograma de Pagos", pageWidth / 2, finalY, { align: "center" });
    doc.setFontSize(PDF_CONFIG.fonts.titleSize);
    doc.setFont("helvetica", "normal");
    doc.setTextColor(...PDF_CONFIG.colors.textSecondary);
    doc.text("Detalle del Préstamo Solicitado", pageWidth / 2, finalY + 15, {
      align: "center",
    });

    finalY += 60;

    // --- 2. Sección de Información del Préstamo (usando autoTable para alineación perfecta) ---
    const infoBody = [
      [
        { content: "Cliente:", styles: { fontStyle: "bold" } },
        data.cliente,
        { content: "Plazo:", styles: { fontStyle: "bold" } },
        data.plazo,
      ],
      [
        { content: "DNI:", styles: { fontStyle: "bold" } },
        data.dni,
        { content: "Cuota Mensual:", styles: { fontStyle: "bold" } },
        data.cuota,
      ],
      [
        { content: "Monto Solicitado:", styles: { fontStyle: "bold" } },
        data.monto,
        { content: "Fecha de Inicio:", styles: { fontStyle: "bold" } },
        data.fechaInicio,
      ],
      [
        { content: "TEA:", styles: { fontStyle: "bold" } },
        data.tea,
        { content: "Es PEP:", styles: { fontStyle: "bold" } },
        data.pep,
      ],
    ];

    doc.autoTable({
      startY: finalY,
      body: infoBody,
      theme: "plain",
      styles: {
        fontSize: PDF_CONFIG.fonts.normalSize,
        textColor: PDF_CONFIG.colors.textPrimary,
      },
      columnStyles: {
        0: { cellWidth: 100 },
        1: { cellWidth: "auto" },
        2: { cellWidth: 100 },
        3: { cellWidth: "auto" },
      },
    });

    finalY = doc.lastAutoTable.finalY + 20;

    // --- 3. Tabla del Cronograma de Pagos ---
    const tableBody = data.cronograma.map((fila) => [
      fila.numero,
      fila.fecha,
      fila.montoCuota,
    ]);

    doc.autoTable({
      startY: finalY,
      head: [["# Cuota", "Fecha de Vencimiento", "Monto de Cuota (S/)"]],
      body: tableBody,
      theme: "grid",
      headStyles: {
        fillColor: PDF_CONFIG.colors.primary,
        textColor: [255, 255, 255],
        fontStyle: "bold",
        halign: "center",
      },
      styles: {
        fontSize: PDF_CONFIG.fonts.normalSize,
        cellPadding: 5,
        textColor: PDF_CONFIG.colors.textPrimary,
        lineColor: PDF_CONFIG.colors.border,
        lineWidth: 0.5,
      },
      columnStyles: {
        0: { halign: "center", cellWidth: 60 },
        1: { halign: "center" },
        2: { halign: "right" },
      },
      margin: {
        left: PDF_CONFIG.margins.left,
        right: PDF_CONFIG.margins.right,
      },
    });

    finalY = doc.lastAutoTable.finalY;

    // --- 4. Pie de Página ---
    const pageCount = doc.internal.getNumberOfPages();
    for (let i = 1; i <= pageCount; i++) {
      doc.setPage(i); // Cambia a la página i
      const pageHeight = doc.internal.pageSize.getHeight();

      // Dibuja una línea de separación
      doc.setDrawColor(...PDF_CONFIG.colors.border);
      doc.line(
        PDF_CONFIG.margins.left,
        pageHeight - PDF_CONFIG.margins.bottom + 10,
        pageWidth - PDF_CONFIG.margins.right,
        pageHeight - PDF_CONFIG.margins.bottom + 10
      );

      // Texto del pie de página
      doc.setFont("helvetica", "normal");
      doc.setFontSize(PDF_CONFIG.fonts.footerSize);
      doc.setTextColor(...PDF_CONFIG.colors.textSecondary);
      const fechaGeneracion = new Date().toLocaleDateString("es-PE");
      doc.text(
        `Documento informativo generado por PrestaPe el ${fechaGeneracion}.`,
        PDF_CONFIG.margins.left,
        pageHeight - PDF_CONFIG.margins.bottom + 25
      );

      // Numeración de página
      doc.text(
        `Página ${i} de ${pageCount}`,
        pageWidth - PDF_CONFIG.margins.right,
        pageHeight - PDF_CONFIG.margins.bottom + 25,
        { align: "right" }
      );
    }

    // --- 5. Guardar el Documento ---
    doc.save(`Cronograma_Prestamo_${data.dni || "cliente"}.pdf`);
  }

  // Exponer la función globalmente para que pueda ser llamada desde el HTML.
  window.GenerarPdf = {
    exportCronogramaPdf,
  };
})();
